import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';

import logo from '../img/logo-menu.png';

import './styles.scss';

class MenuMobile extends Component {
  render() {

    let MenuClass = "menuMobile";

    if (this.props.isOpen) {
      MenuClass += " open";
    }

    return(
      <nav className={ MenuClass }>
        <div className="logoContainer">
          <img src={logo} alt="Logo"/>
        </div>
        <Link className="mobileLinks" to="/">Como Jogar</Link>
        <Link className="mobileLinks" to="/">Regras</Link>
        <Link className="mobileLinks" to="/">Compre Stars</Link>
        <Link className="mobileLinks" to="/">Ranking</Link>
        <Link className="mobileLinks" to="/">Contato</Link>
        <Link className="mobileLinks" to="/cadastro">Participe</Link>
      </nav>
    );
  };
};

MenuMobile.propTypes = {
  isOpen: PropTypes.bool.isRequired
};

export default MenuMobile;
